import Link from 'next/link';

export default class Channels extends React.Component {

    render() {
        return (
            <div>
                <Link href="/player"><button type="button" className="btn btn-outline-info" >Ant1</button></Link>
                <Link href="/player"><button type="button" className="btn btn-outline-info" >Alpha</button></Link>
                <Link href="/player"><button type="button" className="btn btn-outline-info" >Mega</button></Link>
                <Link href="/player"><button type="button" className="btn btn-outline-info" >Star</button></Link>
                <Link href="/player"><button type="button" className="btn btn-outline-info" >Skai</button></Link>
                <Link href="/player"><button type="button" className="btn btn-outline-info" >Ert1</button></Link>
                <Link href="/player"><button type="button" className="btn btn-outline-info" >Ert2</button></Link>
                <Link href="/player"><button type="button" className="btn btn-outline-info" >Ert3</button></Link>
            </div>
        )
    }
}
